  `phoneNumber` varchar(255) DEFAULT NULL,
  `profilPic` longblob,
  `userName` varchar(255) DEFAULT NULL,
  `userType` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`userId`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8;

